INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (1, 'Thỏ Bảy Màu Và Những Người Nghĩ Nó Là Bạn', 80000, '13 x 19 cm', 160, 1, 1, '', '<p>&nbsp;</p>\r\n<p>Thỏ Bảy Màu là một nhân vật hư cấu chẳng còn xa lạ gì với anh em dùng mạng xã hội với slogan “Nghe lời Thỏ, kiếp này coi như bỏ!”.</p>\r\n<p>&nbsp;</p>\r\n<p>Thỏ Bảy Màu đơn giản chỉ là một con thỏ trắng với sự dở hơi, ngang ngược nhưng đáng yêu vô cùng tận. Nó luôn nghĩ rằng mình không có cuộc sống và không có bạn bè. Tuy nhiên, Thỏ lại chẳng bao giờ thấy cô đơn vì đến cô đơn cũng bỏ nó mà đi.</p>\r\n<p>&nbsp;</p>\r\n<p>Cuốn sách là những mẩu chuyện nhỏ được ghi lại bằng tranh xoay quanh Thỏ Bảy Màu và những người nghĩ nó là bạn. Những mẩu chuyện được truyền tải rất “teen” đậm chất hài hước, châm biếm qua sự sáng tạo không kém phần “mặn mà” của tác giả càng trở nên độc đáo và thu hút.</p>\r\n<p>&nbsp;</p>\r\n<p>Nếu một ngày bạn lỡ cảm thấy buồn thì hãy đọc cuốn sách này để biết thế nào là cười sảng nha!</p>', '1,2', '2023-12-1 22:26:04', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (2, 'Gia Đình Dzăn Hoá - Nơi Tình Yêu Bắt Đầu Bất Ổn', 90000, '15x19 cm', 160, 2, 1, '', '\r\n</tr></tbody></table><p><strong>GIỚI THIỆU TÁC GIẢ</strong></p>\r\n<p>Team content, hoạ sĩ của BT Studio là dàn admin của fanpage giải trí có hàng trăm nghìn lượt follow - Gia Đình Dzăn Hoá. Đây là nơi ghi lại bằng tranh những câu chuyện, tình huống vui nhộn, thú vị trong cuộc sống thường ngày, của một gia đình “kiểu mẫu\", mà bất cứ ai cũng thấy bóng dáng gia đình mình trong đó.</p>\r\n<p>&nbsp;</p>\r\n<p><strong>GIỚI THIỆU TÁC PHẨM</strong></p>\r\n<p><em><strong>GIA ĐÌNH DZĂN HOÁ - NƠI TÌNH YÊU BẮT ĐẦU BẤT ỔN</strong></em></p>\r\n<p><em>Gắn kết yêu thương từ những điều nhỏ nhất!</em></p>\r\n<p>&nbsp;</p>\r\n<p>Gia đình dzăn hoá là cuốn truyện tranh tổng hợp những mẩu chuyện nhỏ xoay quanh cuộc sống gia đình thường nhật của một gia đình “bất ổn\", gồm 4 thành viên: Nguyễn Văn Bố, Hoàng Thị Mẹ - Cô Ba phú gia, Bé Hai và cậu út Mike. Thỉnh thoảng sẽ có sự góp mặt của dàn “khách mời đặc biệt” như ông ngoại cháy bá cháy, hoàng thượng Vàng và quý phi Đen…</p>\r\n<p>&nbsp;</p>\r\n<p>Qua 8 chương sách, dàn admin và hoạ sĩ của fanpage giải trí “Gia đình dzăn hoá\" sẽ hé lộ chuyện tình “sóng gió\" của Văn Bố và Thị Mẹ từ thời quen nhau, yêu nhau, cưới nhau và… (đọc sách mới biết phần còn lại nhé)!</p>\r\n<p>&nbsp;</p>\r\n<p>Không chỉ mang lại những tiếng cười sảng khoái qua các tình huống “dở khóc dở cười\" trong cuộc sống hôn nhân, gia đình. Cuốn sách còn nhắc nhở chúng ta dành nhiều thời gian hơn, quan tâm nhiều hơn tới những người thân yêu xung quanh.</p>\r\n<p>&nbsp;</p>\r\n<ul><li>Đọc để hiểu hơn những vất vả, hy sinh của bố mẹ, để yêu hơn những lần mẹ “cằn nhằn\", thương hơn những lần bố “gắt gỏng\" vì lắng lo.</li>\r\n<li>Đọc để hiểu hơn sự khác biệt thế hệ, để biết rằng con cái cũng có những góc nhìn và quan điểm riêng, không phải lúc nào cũng hợp ý bố mẹ nhưng không phải lúc nào cũng sai.</li>\r\n<li>Đọc để thấy cuộc sống hôn nhân không hề dễ dàng, những khi tranh cãi, vụn vỡ là để giúp chúng ta thấu hiểu và cảm thông cho nhau nhiều hơn.</li>\r\n<li>Đọc để yêu hơn những phút giây bình dị hàng ngày, khi chúng ta vẫn được ở bên cạnh những người thân thương…</li>\r\n</ul><p>&nbsp;</p>\r\n<p>Hy vọng cuốn sách sẽ mang lại cho bạn những phút giây giải trí, thư giãn, bên cạnh các gánh nặng nợ môn, điểm số, hạn chót nộp bài…</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '1,2', '2023-12-1 22:26:04', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (3, 'A Box Of Siin Hộp Truyện Siêu Ngắn', 79000, '13x19 cm', 184, 3, 1, '', '<p><strong>Giới thiệu tác giả</strong></p>\r\n<p>&nbsp;</p>\r\n<p><em>Đỗ Tiến.</em></p>\r\n<p>Sở hữu trang Fanpage với hơn 400.000 lượt theo dõi. Ngay từ lần đầu xuất hiện trên mạng xã hội,&nbsp;Đỗ Tiến&nbsp;đã thu hút một lượng lớn độc giả ở nhiều lứa tuổi bằng nét vẽ dễ thương cùng tình tiết nhẹ nhàng, hài hước.</p>\r\n<p>&nbsp;</p>\r\n<p>Với những mẫu chuyện nhỏ xoay quanh nhân vật chính là anh chàng Siin cùng cô người yêu Nu và những người bạn của mình. Những câu chuyện được truyền tải rất “teen” đậm chất hài hước, châm biếm và cực kì bắt trend qua sự sáng tạo không kém phần “mặn” - “lầy” từ &nbsp;tác giả.</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Giới thiệu tác phẩm</strong></p>\r\n<p>&nbsp;</p>\r\n<p><em>Khác biệt - mặn mà - duyên dáng</em></p>\r\n<p>&nbsp;</p>\r\n<p>Đó là 3 tính từ chính xác nhất để miêu tả về Siin - nhân vật với những phát ngôn mặn mà độc đáo đã không còn quá xa lạ đối với các bạn trẻ trên mạng xã hội.&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>“A Box Of Siin - Hộp truyện siêu ngắn” cuốn truyện tranh đầu tay tổng hợp những câu chuyện đời thường thông qua góc nhìn vô cùng hài hước và độc đáo của Siin. Từ chuyện thả thính, yêu đương đến chuyện tiền nong, bạn bè mà bất cứ ai cũng sẽ gặp phải.</p>\r\n<p>&nbsp;</p>\r\n<p>Vào Tết này, bạn sẽ chẳng phải cô đơn vì: “Ai cũng có đôi, mỗi tôi có sảnh”</p>\r\n<p>&nbsp;</p>\r\n<p>Hay những câu châm ngôn về tình yêu vô cùng bá đạo khiến bạn đắng lòng: “Yêu em, tôi nhìn thấy cả thế giới… bởi vì chiều cao của em chưa bao giờ chắn tầm nhìn của tôi cả.”</p>\r\n<p>&nbsp;</p>\r\n<p>Nếu cột sống của bạn đang có quá nhiều áp lực, hãy tìm tới “A Box Of Siin - Hộp truyện siêu ngắn” để tạm bốc hơi khỏi những muộn phiền thường ngày và được cười thật sảng khoái dịp cuối năm bạn nhé!</p>\r\n<p><br>Đảm bảo là được cười sảng luôn!</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '', '2023-12-1 22:26:04', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (4, 'Những Cuộc Phiêu Lưu Của Sherlock Holmes', 58000, '14.5 x 20.5 cm', 229, 4, 4, '', '<p style=\"text-align: justify;\"><strong><span style=\"color: rgb(255, 102, 0); font-size: medium;\"><span>Series Truyện Tranh Kiệt Tác Văn Chương - Những Cuộc Phiêu Lưu Của &nbsp;Sherlock Holmes</span><br></span></strong></p>\r\n<p style=\"text-align: justify;\"><strong>Series Truyện Tranh Kiệt Tác Văn Chương</strong> tập hợp những kiệt tác văn chương thế giới được thể hiện bằng một hình thức mới. Bên cạnh nội dung của kiệt tác là những hình ảnh minh họa sinh động khiến tác phẩm kinh điển trở nên vô cùng hấp dẫn.</p>\r\n<p style=\"text-align: justify;\">Cuốn sách <strong>Series Truyện Tranh Kiệt Tác Văn Chương - Những Cuộc Phiêu Lưu Của &nbsp;Sherlock Holmes</strong> gồm những nội dung chính như sau:</p>\r\n<p style=\"text-align: justify;\">Chương 1: Bức tượng Napoleon thứ 6</p>\r\n<p style=\"text-align: justify;\">Chương 2: Dải băng lốm đốm</p>\r\n<p style=\"text-align: justify;\">Chương 3: Hội tóc đỏ</p>\r\n<p style=\"text-align: justify;\">Chương 4: Vụ án cuối cùng</p>\r\n<p style=\"text-align: justify;\">Chương 5: Ngôi nhà trống rỗng</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p>', '4', '2023-12-1 22:45:25', NULL);
