INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (6, 'Vật Lý Thiên Văn Cho Người Vội Vã', 48000, '14x20.5 cm', 184, 7, 5, '', '“Neil deGrasse Tyson đã tạo ra một Big Bang với Vật lý thiên văn cho người vội vã.” -Vanity Fair Bởi ngay trong tuần phát hành đầu tiên, cuốn sách khoa học đã chiếm luôn vị trí số 1 trong bảng xếp hạng sách bán chạy của The New York Times, rồi hiên ngang trụ lại trong bảng xếp hạng này suốt 20 tuần liên tục. Một tác phẩm thông minh dí dỏm và dễ đọc, có thể cuốn hút cả những người bận rộn nhất, giúp họ chỉ tranh thủ những phút rảnh rỗi mà có được lượng kiến thức khổng lồ, thú vị về thế giới vật lý thiên văn: từ Big Bang cho đến vật chất tối, năng lượng tối; từ hệ mặt trời tới những khám phá không gian liên hành tinh; từ lý thuyết nền tảng của Einstein tới những kịch bản về tương lai vũ trụ…', '4', '2023-12-2 18:05:53', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (10, 'Ai Hát Giữa Rừng Khuya', 49000, '13,5 x 20,5cm', 100, 9, 6, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\"><p>TchyA từng rất nổi danh bởi những vần thơ được gọt dũa điêu luyện, đầy thanh tao ý tứ, mang hơi hướng thơ Đường, và đặc biệt là tác giả của rất nhiều truyện truyền kỳ – kinh dị chịu ảnh hưởng phong cách liêu trai. Ông là một trong số không nhiều những nhà văn trước năm 1945 chuyên viết về thể loại văn chương này, được xem là “cha đẻ” của ma trành và thần hổ – những nhân vật tưởng như hoang đường kỳ dị mà rất đời, ám ảnh hàng chục thế hệ độc giả bấy lâu nay… “Ai hát giữa rừng khuya” là một tiểu thuyết kinh dị nổi bật của ông. </p>\r\n<p>Tiểu thuyết “Ai hát giữa rừng khuya” là một trong những tác phẩm văn học kinh dị nổi tiếng nhất của Việt Nam. Tiểu thuyết của nhà văn TchyA (tên thật là Đái Đức Tuấn) kể về đời hồng nhan bạc phận của nàng đào kép Oanh Cơ. Mồ côi cha mẹ từ nhỏ sống cùng anh và chị. 3 anh chị em đùm bọc nhau, sống bằng nghề đàn hát. Mong có cơ hội đổi đời, họ cùng nhau dấn thân vào vùng rừng thiêng nước độc. Định mệnh khiến họ phải xa lìa nhau, chỉ còn lại tiếng đàn ai oán của Huyền Cơ còn vang vọng. </p>\r\n<p>Những bí ẩn cuộc đời nàng dần dần được tiết lộ.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '5', '2023-12-2 18:22:03', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (13, 'Ba Hồi Kinh Dị', 31000, '13,5 x 20,5cm', 100, 8, 6, '', '“Xuất bản tập Ba hồi kinh dị này, chúng tôi muốn giới thiệu với bạn đọc tập văn phẩm đầu tiên của ông Thế Lữ, để các bạn chú ý đến vết tích thứ nhất trong văn nghiệp của tác giả Vàng và máu và Trại Bồ Tùng Linh. Trong tập này có những đặc điểm nào có thể gọi là dấu hiệu báo trước những tác phẩm về sau của tác giả? Điều đó xin để nhà phê bình và cái trí phê bình minh mẫn của bạn đọc tìm ra. Ở đây chúng tôi chỉ cần phải nói trước để các bạn biết rằng, ba đoản thiên trong tập này viết ra trước đây đã ngót hai mươi năm, và ra đời sau đó ít lâu, nhưng trong một thể văn còn đơn giản, ngây thơ mà tác giả gọi là vụng dại. Tác giả đã tỏ ý ân hận về những “sản phẩm của tuổi trẻ dại” ấy trong cuộc trưng cầu ý kiến của một tờ tuần báo, coi là một lầm lỗi cần phải chuộc. Tác giả đã chuộc bằng cách đem viết cả lại thành những tác phẩm mới, và chỉ duy cái công trình sửa lại này tác giả mới công nhận là sản phẩm chính thức đầu tiên mang tên ký của mình.” - Đại La', '5', '2023-12-2 18:25:52', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
    (14, 'Vật Lí Hạt Nhân Cho Trẻ Em', 24000, '20.3 x 20.3 cm', 28, 10, 7, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\" style=\"\"><p>Nhà xuất bản Phụ nữ Việt Nam phát hành trên toàn quốc tháng 11 năm 2020</p>\r\n<ul><li>Optical Physics – Quang học cho trẻ em (Nguyễn Việt Long dịch)</li>\r\n<li>Nuclear Physics – Vật lí hạt nhân cho trẻ em (Nguyễn Việt Long dịch)</li>\r\n<li>ABCs of Science – Khoa học từ A đến Z (Vũ Trần An Phố dịch/N.Việt Long h.đính)</li>\r\n<li>ABCs of Biology – Sinh học từ A đến Z (Tillie Phạm dịch/ N.Việt Long h.đính)</li>\r\n<li>ABCs of Maths – Toán học từ A đến Z (Tillie Phạm dịch/ N.Việt Long h.đính)</li>\r\n<li>Quantum Info – Thông tin lượng tử cho trẻ em (Nguyễn Thị Quỳnh Giang dịch)</li>\r\n<li>Quantum Computing – Điện toán lượng tử cho trẻ em (N.T.Quỳnh Giang dịch)</li>\r\n<li>8 Little Planets – 8 Hành tinh nhỏ xinh (Lê Thị Thu Ngọc dịch)</li>\r\n<li>Astrophysics – Vật lí học thiên thể cho trẻ em (Lê Thị Thu Ngọc dịch)</li>\r\n</ul><p>Đây là 9 cuốn trong bộ sách Vỡ lòng về Khoa học của tác giả Chris Ferrie đã được nhiều quốc gia đón nhận (những chủ đề tiếp theo sẽ ra mắt trong thời gian tới). Khi quan điểm giáo dục sớm cũng như xu hướng STEAM (khoa học – công nghệ – kĩ thuật – nghệ thuật – toán học) đang ngày càng chứng minh sự hiệu quả đối với học sinh thì bộ sách vỡ lòng về khoa học này chính là một trong những nguồn tài liệu tham khảo mà trẻ em cần. Những cuốn sách nhanh chóng đạt xếp hạng cao nhờ đáp ứng rất tốt các tiêu chí: nội dung chuẩn xác, cô đọng, minh họa “trực quan”, sáng rõ – phù hợp với khả năng tiếp thu của các em từ tuổi 4+.</p>\r\n<p>Ở góc độ của một nhà vật lí và nhà toán học luôn tin tưởng, yêu quý trẻ em, Chris Ferrie khẳng định rằng “không bao giờ là quá sớm để giới thiệu trẻ em đến với thế giới khoa học kì lạ và tuyệt vời!” Chính vì vậy, tác giả đã dày công “giản lược” những kiến thức thuộc lĩnh vực toán học, vật lí, sinh học, quang học cho đến các nhánh lượng tử, hạt nhâ nhằm giúp các bé tiếp cận với nền khoa học một cách cơ bản, hiệu quả nhất. Thật đáng kinh ngạc khi những cuốn sách gồm 10-20 trang lại chứa đựng nguồn kiến thức nền tảng phong phú, hấp dẫn tới như vậy.</p>\r\n<p>Cũng như tác giả Chris Ferrie, nhà xuất bản Phụ nữ Việt Nam tin rằng năng lực tìm tòi, khám phá của trẻ em là vô tận. Bộ sách vỡ lòng về khoa học sẽ góp phần “đánh thức” ước mơ trở thành những nhà khoa học, những kĩ sư công nghệ trong các em, và đó là cách chúng ta ươm-cây cho tương lai.<br><br><strong>Trang bản quyền:</strong></p>\r\n<ul><li>1. 8 LITTLE PLANETS by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>2. ABCS OF BIOLOGY by CHRIS FERRIE AND CARA FLORANCE Copyright: Chris Ferrie, Cara Florance</li>\r\n<li>3. ABCS OF MATHEMATICS by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>4. ABCS OF SCIENCE by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>5. ABCS OF SPACE by CHRIS FERRIE AND JULIA KREGENOW Copyright: Chris Ferrie, Julia Kregenow</li>\r\n<li>6. ASTROPHYSICS FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>7. NUCLEAR PHYSICS FOR BABIES by CHRIS FERRIE AND CARA FLORANCE Copyright: Chris Ferrie, Cara Florance</li>\r\n<li>8. OPTICAL PHYSICS FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>9. QUANTUM INFORMATION FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n<li>10. QUANTUM COMPUTING FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie</li>\r\n</ul><p>This edition arranged with SOURCEBOOKS, INC. through BIG APPLE AGENCY, INC., LABUAN, MALAYSIA. VIETNAMESE edition copyright: 2020 Viet Nam Women\'s Publishing House. All rights reserved.<br><br>Bản quyền tiếng Việt Nhà xuất bản Phụ nữ Việt Nam</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '6', '2023-12-2 18:34:33', NULL);
