 SPACE by CHRIS FERRIE AND JULIA KREGENOW Copyright: Chris Ferrie, Julia Kregenow<br>6. ASTROPHYSICS FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie<br>7. NUCLEAR PHYSICS FOR BABIES by CHRIS FERRIE AND CARA FLORANCE Copyright: Chris Ferrie, Cara Florance<br>8. OPTICAL PHYSICS FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie<br>9. QUANTUM INFORMATION FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie<br>10. QUANTUM COMPUTING FOR BABIES by CHRIS FERRIE Copyright: Chris Ferrie<br><br>This edition arranged with SOURCEBOOKS, INC. through BIG APPLE AGENCY, INC., LABUAN, MALAYSIA. VIETNAMESE edition copyright: 2020 Viet Nam Women\'s Publishing House. All rights reserved.<br><br>Bản quyền tiếng Việt Nhà xuất bản Phụ nữ Việt Nam</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p><div class=\"gradient\"></div></div>', '6', '2023-12-2 18:37:17', NULL);
