(17, 'Quan Trọng Là Phải Đẹp Trai', 77000, '13 x 19cm', 164, 11, 8, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\"><p style=\"box-sizing: border-box; margin: 5px 0px 12px; color: rgb(36, 36, 36); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;\"><span style=\"box-sizing: border-box;\">Quan Trọng Là Phải Đẹp Trai&nbsp;</span>cho thấy một góc nhìn vô cùng hài hước của Thăng Fly. Và theo tôi, đó là sự độc đáo mang tính tích cực. Khi gặp khó khăn trong cuộc sống, khi trục trặc trong chuyện tình cảm, khi công việc không suôn sẻ , nếu là một người chúng ta sẽ tìm lý do gì đó, một ai đó để đổ lỗi, để giải tỏa. Nhưng đối với Thăng, cách giải thích của anh chỉ: \"Đơn giản... vì bạn không đẹp trai!\". Một lý do khiến người đọc không biết làm gì khác ngoài bật cười.</p>\r\n<p style=\"box-sizing: border-box; margin: 5px 0px 12px; color: rgb(36, 36, 36); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;\">Cuốn sách này tập hợp những câu chuyện tưởng chừng như vô thưởng vô phạt, những kỷ niệm tếu táo thời sinh viên, những trò đùa nhắng nhít, những mối tình e ngại không dám nói... mà bạn chắc chắn sẽ cảm thấy bản thân mình trong đó.\"</p>\r\n<p style=\"box-sizing: border-box; margin: 5px 0px 12px; color: rgb(36, 36, 36); font-family: Roboto, Helvetica, Arial, sans-serif; font-size: 13px; text-align: justify;\"><span style=\"box-sizing: border-box;\">(Nguyễn Thành Dương - tác giả kịch bản Long Thần Tướng)</span></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '2', '2023-12-2 18:40:17', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(18, 'Súng, Vi Trùng Và Thép', 270000, '14 x 20.5cm', 300, 12, 9, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\"><p style=\"text-align: justify;\">\"Bàn tay của diễn trình lịch sử từ 8.000 năm trước vẫn đang đè nặng lên chúng ta.\"<br> Cuốn sách giải thích vì sao các nền văn minh Á – Âu (bao gồm cả Bắc Phi) lại tồn tại được, cũng như đã chinh phục các nền văn minh khác, cùng lúc ông bác bỏ các lý thuyết về sự thống trị của các nền văn minh Á –Âu dựa trên trí tuệ, đạo đức hay ưu thế di truyền. Jared Diamond lập luận rằng, sự khác biệt về quyền lực và công nghệ giữa các xã hội loài người có nguồn gốc từ sự khác biệt về môi trường, trong đó sự khác biệt này được khuếch đại không ngường. Qua đó, ông giải thích tại sao Tây Âu, chứ không phải các nền văn minh khác trong thế giới Á – Âu như Trung Quốc, lại trở thành các thế lực thống trị<br> Mục đích của cuốn sách này là cung cấp một lược sử về tất cả mọi người trong khoảng 13.000 năm trở lại đây. Câu hỏi đã khiến tôi viết ra cuốn sách này là: tại sao lịch sử đã diễn ra trên mỗi châu lục một khác? Nếu như câu hỏi này lập tức khiến bạn nhún vai cho rằng bạn sắp phải đọc một luận văn phân biệt chủng tộc thì, xin thưa, không phải vậy. Như bạn sẽ thấy, những lời đáp cho câu hỏi này tuyệt không bao hàm những sự khác biệt về chủng tộc. Cuốn sách này tập trung truy tìm những lý giải tối hậu và đẩy lùi chuỗi nhân quả lịch sử càng xa bao nhiêu càng tốt bấy nhiêu.<br> Tuy cuốn sách này nói cho cùng là về lịch sử và tiền sử, song chủ đề của nó không chỉ có giá trị hàn lâm mà còn có tầm quan trọng to lớn về thực tiễn và chính trị. Lịch sử những tương tác giữa các dân tộc khác nhau chính là cái đã định hình thế giới hiện đại thông qua sự chinh phục, bệnh truyền nhiễm và diệt chủng. Các xung đột đó tạo ra những ảnh hưởng lâu dài mà sau nhiều thế kỷ vẫn chưa thôi tác động, vẫn đang tích cực tiếp diễn ở một số khu vực nhiều vấn đề nhất của thế giới ngày nay.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '7', '2023-12-2 18:43:06', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(19, 'Trường Pháp Ở Việt Nam 1945 -1975', 160000, '16 x 24cm', 348, 13, 10, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\" style=\"overflow: hidden; height: 500px;\"><p>Cuốn sách này, bắt nguồn từ luận án tiến sỹ của tác giả, đã hoàn thành vai trò của mình là làm sống lại thiên truyện về nền giáo dục Pháp tại Việt Nam trong ba thập niên bản lề của lịch sử đất nước này trong thế kỷ 20 (1945-1975).</p>\r\n<p>Mục đích của cuốn sách này là miêu tả và phân tích hệ thống giáo dục Pháp tại miền Bắc và miền Nam Việt Nam sau 1945 ở những bình diện chính sách, tổ chức và cách thức vận hành. Ba chương trong sách sẽ chỉ ra, dưới sức nặng của những toan tính chính trị quốc tế cũng như áp lực từ phía các gia đình Việt đến trường Pháp, nước Pháp đã cải tổ một cách tài tình như thế nào để biến hệ thống giáo dục thuộc địa kiên cố, vốn được coi là mũi giáo của sứ mạng khai hóa, thành một công cụ phục vụ cho ngoại giao văn hóa. Đây là một thứ ngoại giao mới mà các chính thể Nhà nước muốn sử dụng, cho mục đích đối ngoại, nhằm truyền bá những sản phẩm mang tính biểu tượng của một nền văn hóa như nghệ thuật, văn chương, hay truyền bá tri thức thông qua giáo dục.</p>\r\n<p>Cuốn sách giới thiệu cô đọng những đặc điểm căn bản của giáo dục Đông Dương thuộc địa, giúp độc giả khám phá tiến trình ít nhiều bị cưỡng ép để biến “sứ mạng khai hóa” thành một thứ “Phái bộ văn hóa” thích ứng linh động hơn với điều kiện chính trị và chiến cuộc từ 1945 đến 1954. Đồng thời phân tích sự phát triển của hệ thống trường Pháp tại miền Nam từ 1954 đến 1975 trong bộ “áo choàng ngoại giao” mới dưới thời chính quyền Việt Nam Cộng hòa có sự hậu thuẫn của Mỹ. <br>Trong cuốn sách cũng kèm rất nhiều lời chứng được thu thập ở Pháp và Việt Nam giúp chúng ta như thâm nhập thực sự vào thế giới học đường, phát hiện ra các mật mã, ngôn ngữ, những ước vọng và lo âu của nó. Lời chứng cũng kể lại những mối quan hệ giữa các học sinh, giữa học sinh và giáo viên. Nó tái dựng những mạng lưới, hệ giá trị, biến chuyển tư tưởng, những thú vui giải trí, thậm chí cả những bộ phim mà học sinh thời đó chuộng xem. Ngoài những cuộc phỏng vấn trực tiếp và bảng hỏi, tác giả cũng tra cứu các tập san và ấn phẩm định kỳ cùng với các nguồn lưu trữ thuộc địa và ngoại giao. Vì vậy, những phân tích sử học, mang những điểm nhìn phong phú, khi thì văn hóa, khi thì thống kê, thực sự gây ấn tượng với độc giả.</p>\r\n<p><strong>ĐÁNH GIÁ/NHẬN XÉT CHUYÊN GIA</strong></p>\r\n<p>Công trình này làm sáng tỏ những số phận, những tuổi thơ, những khám phá và những phát kiến mới về bản sắc, và cả những lập trường phức tạp thường trái chiều so với những gì mà độc giả có thể mong đợi. Cuốn sách mở ra một thế giới cosmopolite và đứt gãy, những tuổi thơ di trú từ Bắc vào Nam, rồi ra ngoại quốc, những đường đời zigzag. Chúng ta có thể nghĩ rằng thế giới đó đã biến mất nếu như nó không để lại dấu ấn sâu đậm lên nhiều thế hệ và nhất là nó vẫn còn thời sự trong thế giới đầy biến chuyển ngày nay.&nbsp;</p>\r\n<p>Eric Jennings - Giáo sư Sử học, Đại học Toronto</p>\r\n<p>Cuốn sách này của một nhà nghiên cứu trẻ tài năng đã cho thấy trong một thế giới bị đảo lộn bởi giải thuộc địa, giáo dục nằm ở tâm điểm của những toan tính chính trị, ngoại giao, văn hóa và sự gìn giữ bản sắc. Một câu chuyện đáng để khám phá và suy ngẫm ở kỷ nguyên toàn cầu hóa.</p>\r\n<p>Rebecca Rogers - Giáo sử Lịch sử, ĐH Paris Descartes, Sorbonne Paris Cité</p>\r\n<p><strong>TRÍCH ĐOẠN HAY</strong></p>\r\n<p>“Di sản cơ bản nhất mà nền giáo dục thuộc địa để lại là sự tiếp nhận chữ Quốc ngữ của người Việt, tạo nên một nền báo chí và văn chương phong phú và đa dạng2. Trên phương diện sư phạm, giáo dục thuộc địa đưa những môn khoa học tự nhiên và kỹ thuật vào chương trình, mở ra cánh cửa văn hóa, văn chương và triết học ngoài khuôn khổ Khổng giáo và kiến thức nghệ thuật cũng vượt khỏi khuôn khổ Á châu3. Trên phương diện xã hội, giáo dục nữ sinh góp phần làm thay đổi địa vị phụ nữ trong xã hội. Ngoài ra phải kể đến giáo dục cho các dân tộc thiểu số và việc hiện đại hóa trường chùa ở Lào và Campuchia.”</p>\r\n<p>“Ở những thập niên đầu của thế kỷ 20, tầng lớp tinh hoa Đông Dương kiểu mới được đào tạo trong nhà trường Pháp, tha thiết với quá trình hiện đại hóa, đã bắt đầu tìm cách tận dụng những lợi ích của “sứ mạng khai hóa”. Họ đòi hỏi cho con cái họ được học lên bậc trung và đại học, thậm chí trong những ngôi trường trung học danh giá vốn chỉ dành cho học sinh Pháp. Nhưng câu trả lời từ chính quyền không như họ mong đợi. Trường Pháp có tiếp nhận con cái họ nhưng học phí đắt đỏ và đầu ra thì hiếm hoi và bạc bẽo. Hễ khi tình hình chính trị căng thẳng, chính quyền lập tức thít chặt đầu vào ở các trường bên Pháp, chẳng hạn như hạn chế đưa sinh viên Đông Dương sang Pháp trong những năm 1930. Những ai du học ở Pháp quốc trở về đều chung một suy nghĩ những giá trị đang thịnh hành ở chính quốc đều bị mất giá trên chính xứ sở của họ. Học sinh Đông Dương phải tự ý thức được sự bất công về một nền giáo dục ca tụng tự do cá nhân và tinh thần phản biện, trong khi đó việc biểu đạt những giá trị này tại Đông Dương thì sớm muộn sẽ bị trấn áp, ngay cả trên ghế nhà trường. Một bộ phận của thế hệ này, mà nhà xã hội học Trịnh Văn Thảo gọi là “Thế hệ 19252”, sẽ làm cho hàng ngũ theo phái quốc gia, cộng sản và trotskyste đông đảo lên. Vì không còn đủ kiên nhẫn về một cuộc cải tổ thuộc địa giản đơn nên trong cuộc đấu tranh, họ huy động và vận dụng những kỹ năng và kiến thức tiếp thu được từ nhà trường Pháp.”<br>(Chương 1: Từ sứ mạng khai hóa đến phái bộ văn hóa)</p>\r\n<p>Lời kể của các nhân chứng cho thấy ba yếu tố quan trọng tác động đến việc lựa chọn trường Pháp của các gia đình và phụ huynh người Việt. Yếu tố thứ nhất là hoàn cảnh và điều kiện gia đình thuận lợi. Đó chủ yếu là những gia đình khá giả có điều kiện cho con học trường Pháp. Yếu tố thứ hai là sự gần gũi về văn hóa và xã hội với nước Pháp. Đó là những gia đình nói tiếng Pháp, có hiểu biết về văn hóa Pháp và biết rõ về hệ thống giáo dục Pháp ngay dưới thời thuộc địa. Yếu tố thứ ba là ước muốn dành cho con cái một tương lai tốt đẹp nhất có thể trong một môi trường giáo dục chất lượng và ưu việt.<br>(Chương 3: lưu huỳnh, muối và thủy ngân)</p>\r\n<p><strong>VỀ TÁC GIẢ</strong></p>\r\n<p>Nguyễn Thụy Phương</p>\r\n<p>Tiến sĩ Giáo dục (Đại học Paris Descartes, 2013) chuyên về lịch sử giải thực dân văn hóa, giáo dục thuộc địa và hậu thuộc địa.</p>\r\n<p>Phó giám đốc Mạng lưới Giáo dục (EduNet), giám đốc Vietnam Education Symposium, thuộc Tổ chức Khoa học và Chuyên gia Việt Nam Toàn cầu (AVSE Global).</p>\r\n<p>Chuyên gia tư vấn, thẩm định và hợp tác các dự án trong lĩnh vực giáo dục và đào tạo tại Pháp.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p><div class=\"gradient\"></div></div>', '7', '2023-12-2 18:45:35', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(20, 'Hacker Lược Sử', 200000, '16 x 24cm', 200, 14, 11, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\"><p>Cuốn sách nói về những nhân vật, cỗ máy, sự kiện định hình cho văn hóa và đạo đức hacker từ những hacker đời đầu ở đại học MIT.</p>\r\n<p>Câu chuyện hấp dẫn bắt đầu từ các phòng thí nghiệm nghiên cứu máy tính đầu tiên đến các máy tính gia đình.</p>\r\n<p>Tập hợp tài liệu cập nhật từ các tin tặc nổi tiếng như Bill Gates, Mark Zuckerberg, Richard Stallman…</p>\r\n<p>Những sự thật về cuộc sống và con đường trở thành “tin tặc” của những con người đã thay đổi lịch sử phát triển của ngành Công nghệ.</p>\r\n<p>Cuốn&nbsp; sách của Steven Levy ghi lại những chiến công của các tin tặc thời kỳ đầu trong cuộc cách mạng máy tính - những kẻ mê máy tính thông minh và lập dị từ cuối những năm 1950 đến đầu thập niên 1980, dám mạo hiểm, bẻ cong quy tắc và đẩy thế giới vào một hướng đi hoàn toàn mới.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '8', '2023-12-2 18:48:51', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(21, 'Đắc Nhân Tâm', 75000, '14.5 x 20.5 cm', 320, 15, 12, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\" style=\"\"><p><strong><iframe src=\"//www.youtube.com/embed/zSt7oj1NwfA\" width=\"750\" height=\"421\" allowfullscreen=\"\"></iframe></strong></p>\r\n<p>Đắc nhân tâm của Dale Carnegie là quyển sách duy nhất về thể loại self-help liên tục đứng đầu danh mục sách bán chạy nhất (best-selling Books) do báo The New York Times bình chọn suốt 10 năm liền. Được xuất bản năm 1936, với số lượng bán ra hơn 15 triệu bản, tính đến nay, sách đã được dịch ra ở hầu hết các ngôn ngữ, trong đó có cả Việt Nam, và đã nhận được sự đón tiếp nhiệt tình của đọc giả ở hầu hết các quốc gia.</p>\r\n<p>Là quyển sách đầu tiên có ảnh hưởng làm thay đổi cuộc đời của hàng triệu người trên thế giới, Đắc Nhân Tâm là cuốn sách đem lại những giá trị tuyệt vời cho người đọc, bao gồm những lời khuyên cực kì bổ ích về cách ứng xử trong cuộc sống hàng ngày. Sức lan toả của quyển sách vô cùng rộng lớn – với nhiều tầng lớp, đối tượng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/12/b4/ae/e4ff0604b53d2443c7012c665c27fb70.JPG\" alt=\"Đắc Nhân Tâm (Bìa Cứng) - Tái Bản\" width=\"750\" height=\"452\"><br><br>Đắc Nhân Tâm không chỉ là là nghệ thuật thu phục lòng người, Đắc Nhân Tâm còn đem lại cho độc giả góc nhìn, suy nghĩ sâu sắc về việc giao tiếp ứng xử.</p>\r\n<p>Triết lý của Đắc Nhân Tâm là hiểu mình, thành thật với chính mình, từ đó hiểu biết và quan tâm đến những người xung quanh để nhìn ra và khơi gợi những tiềm năng ẩn khuất nơi họ, giúp họ phát triển lên một tầm cao mới. Đây chính là nghệ thuật cao nhất về con người và chính là ý nghĩa sâu sắc nhất đúc kết từ những nguyên tắc vàng của Dale Carnegie.</p>\r\n<p>Đây là phiên bản Đắc Nhân Tâm đặc biệt, bìa cứng dày 320 trang, do First News thực hiện và Nhà xuất bản Tổng hợp TP.HCM ấn hành.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/4a/d2/d2/41e9506da648300ed86640a7f60e300f.JPG\" alt=\"Đắc Nhân Tâm (Bìa Cứng) - Tái Bản\" width=\"750\" height=\"465\"><br><br><em><strong>Một số nguyên tắc – Nghệ thuật ứng xử căn bản:</strong></em></p>\r\n<p>Nguyên tắc 1: Không chỉ trích, oán trách hay than phiền.</p>\r\n<p>Nguyên tắc 2: Thành thật khen ngợi và biết ơn người khác.</p>\r\n<p>Nguyên tắc 3: Gợi cho người khác ý muốn thực hiện điều bạn muốn họ làm.</p>\r\n<p><em><strong>6 cách tạo thiện cảm:</strong></em></p>\r\n<p>Nguyên tắc 4: Thật lòng quan tâm đến người khác.</p>\r\n<p>Nguyên tắc 5: Hãy mỉm cười!</p>\r\n<p>Nguyên tắc 6: Luôn nhớ rằng tên của người khác là một âm thâm êm đềm, thân thương và quan trọng nhất đối với họ.</p>\r\n<p>Nguyên tắc 7: Biết lắng nghe và khuyến khích người khác nói về vấn đề của họ.</p>\r\n<p>Nguyên tắc 8: Nói về điều người khác quan tâm.</p>\r\n<p>Nguyên tắc 9: Thật lòng làm cho người khác cảm thấy họ quan trọng.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/0d/f4/2a/97c38ba1a97b8cb5521d6b19d6145069.JPG\" alt=\"Đắc Nhân Tâm (Bìa Cứng) - Tái Bản\" width=\"750\" height=\"452\"><br><br><em><strong>Báo chí nhắc gì về “Đắc Nhân Tâm”</strong></em></p>\r\n<p><em>“Nói đến sách nghệ thuật ứng xử thì không thể không nhắc đến \"Đắc nhân tâm\" của Dale Carnegie. Đây là một trong những cuốn sách gối đầu của nhiều thế hệ đi trước và ngày nay. Với chặng đường hơn 80 năm kể từ khi lần đầu được xuất bản, \"Đắc nhân tâm\" đã mang đến cho chúng ta bài học vô cùng giá trị đó là nghệ thuật ứng xử để được lòng người. \"Đắc nhân tâm\" là quyển sách nổi tiếng và bán chạy nhất và có mặt ở hàng trăm quốc gia khác nhau, và hơn thế nữa đây còn là quyển sách liên tục đứng đầu danh mục sách bán chạy nhất do thời báo NewYork Times bình chọn trọng suốt 10 năm liền.”</em> – <strong>C, 3 cuốn sách nên đọc đi đọc lại trong đời để ngẫm về cuộc sống</strong></p>\r\n<p><em>“Đắc Nhân Tâm – của tác giả Dale Carnegie là quyển sách nổi tiếng nhất, bán chạy nhất và có tầm ảnh hưởng nhất của mọi thời đại. Tác phẩm đã được chuyển ngữ sang hầu hết các thứ tiếng trên thế giới và có mặt ở hàng trăm quốc gia. Một khám phá rất thú vị dành cho các bậc phụ huynh khi đọc cuốn sách này là biết cách lắng nghe trò chuyện cùng con, cách trị chứng tè dầm của trẻ nhỏ, hay cách làm cho một đứa trẻ từ quậy phá thành ngoan ngoãn… Đó hẳn là những câu chuyện nuôi dạy trẻ rất đúng, rất hay, rất đời thường đáng để bạn đọc suy ngẫm và chiêm nghiệm”</em>. – <strong>M, Đắc nhân tâm: ‘Cha đã quên’ nhắc những điều nên nhớ</strong></p>\r\n<p><em>“Đắc Nhân Tâm” đưa ra những lời khuyên về cách cư xử, ứng xử và giao tiếp với mọi người để đạt được thành công trong cuộc sống. Đây được coi là một trong những cuốn sách nổi tiếng nhất, bán chạy nhất và có tầm ảnh hưởng nhất mọi thời đại mà bạn không nên bỏ qua.”</em> – <strong>C, 20 câu nói vàng đáng nhớ từ tuyệt tác để đời “Đắc Nhân Tâm”</strong>.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/89/79/6b/f36755adae804bd52852b133bb34d829.jpg\" alt=\"Đắc Nhân Tâm (Bìa Cứng) - Tái Bản\" width=\"750\" height=\"496\"><br><br><strong>Về tác giả</strong></p>\r\n<p>Dale Breckenridge Carnegie (24 tháng 11 năm 1888 – 1 tháng 11 năm 1955) là một nhà văn và nhà thuyết trình Mỹ và là người phát triển các lớp tự giáo dục, nghệ thuật bán hàng, huấn luyện đoàn thể, nói trước công chúng và các kỹ năng giao tiếp giữa mọi người. Ra đời trong cảnh nghèo đói tại một trang trại ở Missouri, ông là tác giả cuốn Đắc Nhân Tâm, được xuất bản lần đầu năm 1936, một cuốn sách thuộc hàng bán chạy nhất và được biết đến nhiều nhất cho đến tận ngày nay. Ông cũng viết một cuốn tiểu sử Abraham Lincoln, với tựa đề Lincoln con người chưa biết, và nhiều cuốn sách khác.</p>\r\n<p>Carnegie là một trong những người đầu tiên đề xuất cái ngày nay được gọi là đảm đương trách nhiệm, dù nó chỉ được đề cập tỉ mỉ trong tác phẩm viết của ông. Một trong những ý tưởng chủ chốt trong những cuốn sách của ông là có thể thay đổi thái độ của người khác khi thay đổi sự đối xử của ta với họ.</p>\r\n<p><img src=\"https://salt.tikicdn.com/ts/tmp/3e/db/7f/0aa03e0bd9217c87fe86ffb21102b951.jpg\" alt=\"Đắc Nhân Tâm (Bìa Cứng) - Tái Bản\" width=\"750\" height=\"496\"></p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '8', '2023-12-2 18:50:54', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(22, 'Không Ai Có Thể Làm Bạn Tổn Thương Trừ Khi Bạn Cho Phép', 76000, '14.5 x 20.5 cm', 304, 17, 1, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\" style=\"\"><p>KHÔNG AI CÓ THỂ LÀM BẠN TỔN THƯƠNG TRỪ KHI BẠN CHO PHÉP – YOO EUN JUNG</p>\r\n<p>Chúng ta vẫn thường nghĩ mình sẽ chỉ hạnh phúc khi ở bên cạnh ai đó và nhận được yêu thương từ họ. Nhưng thực chất, hạnh phúc đơn giản chỉ là biết trân trọng bản thân và tận hưởng niềm vui trong chính cuộc sống mà bạn mong ước. Vậy nên, hãy nhớ rằng không ai có thể làm bạn tổn thương, trừ khi bạn cho phép.</p>\r\n<p>Là người đang nghiên cứu và điều trị tâm lý, tác giả Yoo Eun Jung đã chỉ ra góc nhìn hoàn toàn khác về các vấn đề mà bạn gặp phải trong mối quan hệ với những người xung quanh. Quyển sách này vừa chứa đựng những lời tâm tình thủ thỉ của một người bạn, vừa đưa ra các liệu pháp cứng rắn ở cương vị một chuyên gia giúp bạn lần lượt gỡ bỏ những vướng mắc trong lòng. Nếu không phải là đơn thuốc hữu hiệu nhất cho những ai đang cảm thấy mệt mỏi với các mối quan hệ thì nó cũng sẽ là một viên vitamin, hay một viên thuốc bổ để bạn có thể mang theo và bổ sung như một loại dưỡng chất hàng ngày cho tâm lý nhờ những chia sẻ về:</p>\r\n<p>1. Những hội chứng tâm lý có thể bạn đang vô tình mắc phải khiến cuộc sống không được như ý<br>2. Mẹo ứng xử trong giao tiếp với đa dạng các mối quan hệ<br>3. Cách đánh giá tầm quan trọng của bạn trong mắt đối phương<br>4. Những cách để tôn trọng bản thân nhưng không làm mất lòng đối phương<br>5. Căn nguyên của căn bệnh trầm cảm và cách để không lún sâu vào sự trầm uất</p>\r\n<p>Mong bạn luôn giữ cho mình đủ sự thanh thản trong tâm hồn để biết ơn mỗi phút giây được sống, đủ quyết tâm để không đối xử tệ với bản thân cũng như đủ can đảm để bộc lộ những điều bản thân đang mưu cầu. Hãy bình tâm bước và nỗ lực không ngừng vì những điều bản thân mong muốn đạt được, bạn sẽ tự khắc thấy mình hạnh phúc hơn.</p>\r\n<p><strong>Về tác giả: Yoo Eun Jung</strong></p>\r\n<p>Chủ tịch Hội đồng học thuật của Hiệp hội Điều trị Béo phì và Thẩm mỹ Hàn Quốc, và là thành viên ban chỉ đạo của Hiệp hội Tâm thần Cơ đốc giáo Hàn Quốc. Cô ấy đặc biệt quan tâm đến lĩnh vực chánh niệm, giải phóng bản thân khỏi những phiền nhiễu bằng cách tập trung vào “ở đây và ngay bây giờ”. Hiện cô đang nghiên cứu điều trị tâm lý thông qua cách này.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '8,10', '2022-12-13 13:10:44', NULL);
INSERT INTO `books` (`id`, `name`, `price`, `size`, `page`, `authorid`, `publisherid`, `image`, `description`, `category`, `adddate`, `quantity`) VALUES
(23, 'Phác Họa Chân Dung Kẻ Phạm Tội', 100000, '16 x 24 cm', 280, 18, 13, '', '<div class=\"ToggleContent__View-sc-1dbmfaw-0 wyACs\"><p><strong>TÂM LÝ HỌC TỘI PHẠM - PHÁC HỌA CHÂN DUNG KẺ PHẠM TỘI</strong></p>\r\n<p>Tội phạm, nhất là những vụ án mạng, luôn là một chủ đề thu hút sự quan tâm của công chúng, khơi gợi sự hiếu kỳ của bất cứ ai. Một khi đã bắt đầu theo dõi vụ án, hẳn bạn không thể không quan tâm tới kết cục, đặc biệt là cách thức và động cơ của kẻ sát nhân, từ những vụ án phạm vi hẹp cho đến những vụ án làm rúng động cả thế giới.</p>\r\n<p>Lấy 36 vụ án CÓ THẬT kinh điển nhất trong hồ sơ tội phạm của FBI, “Tâm lý học tội phạm - phác họa chân dung kẻ phạm tội” mang đến cái nhìn toàn cảnh của các chuyên gia về chân dung tâm lý tội phạm. Trả lời cho câu hỏi: Làm thế nào phân tích được tâm lý và hành vi tội phạm, từ đó khôi phục sự thật thông qua các manh mối, từ hiện trường vụ án, thời gian, dấu tích,… để tìm ra kẻ sát nhân thực sự.</p>\r\n<p>Đằng sau máu và nước mắt là các câu chuyện rợn tóc gáy về tội ác, góc khuất xã hội và những màn đấu trí đầy gay cấn giữa điều tra viên và kẻ phạm tội. Trong số đó có những con quỷ ăn thịt người; những cô gái xinh đẹp nhưng xảo quyệt; và cả cách trả thù đầy man rợ của các nhà khoa học,… Một số đã sa vào lưới pháp luật ngay khi chúng vừa ra tay, nhưng cũng có những kẻ cứ vậy ngủ yên hơn hai mươi năm.</p>\r\n<p>Bằng giọng văn sắc bén, “Tâm lý học tội phạm - phác họa chân dung kẻ phạm tội” hứa hẹn dẫn dắt người đọc đi qua các cung bậc cảm xúc từ tò mò, ngạc nhiên đến sợ hãi, hoang mang tận cùng. Chúng ta sẽ lần tìm về quá khứ để từng bước gỡ những nút thắt chưa được giải, khiến ta \"ngạt thở\" đọc tới tận trang cuối cùng.</p>\r\n<p>Hy vọng cuốn sách sẽ giúp bạn có cái nhìn sâu sắc, rõ ràng hơn về bộ môn tâm lý học tội phạm và có thể rèn luyện thêm sự tư duy, nhạy bén.</p><p>Giá sản phẩm trên Tiki đã bao gồm thuế theo luật hiện hành. Bên cạnh đó, tuỳ vào loại sản phẩm, hình thức và địa chỉ giao hàng mà có thể phát sinh thêm chi phí khác như phí vận chuyển, phụ phí hàng cồng kềnh, thuế nhập khẩu (đối với đơn hàng giao từ nước ngoài có giá trị trên 1 triệu đồng).....</p></div>', '8,10', '2022-12-13 13:46:46', NULL);

